import { Router } from 'express';

const router = Router();
const medicos = [
	{ nome: 'Fulano', especialidade: 'Cardiologia'},
	{ nome: 'Ciclano', especialidade: 'Odontologia'},
];

router.get ('/medicos-disponiveis', (req, res, next) => {
	res.json({
		Medicos: medicos,
	});
});

router.post('/novo-medico', (req, res, next) => {
  medicos.push(req.body);
  res.json({
    message: 'Médico adicionado com sucesso!',
  });
});

router.get('/:id', (req, res, next) => {
  try {
    const id = req.params.id;
    if (id < 0 || id >= medicos.length) {
      const err = new Error('ID não encontrado');
      err.status = 404;
      throw err;
    }
    res.json({
      Medico: medicos[id],
    });
  } catch (err) {
    next(err);
  }
});

export default router;

